SELECT
	PDXX.DF_SPE_ACC_ID,
	LNXX.LN_SEQ,
	LNXX.LF_FOR_CTL_NUM,
	CONVERT(VARCHAR(XX),LNXX.LD_FOR_BEG,XXX) AS ForbBeginDate,
	CONVERT(VARCHAR(XX),LNXX.LD_FOR_END,XXX) AS ForbEndDate,
	CONVERT(VARCHAR(XX),LNXX.LD_FOR_APL,XXX) AS ForbAppliedDate
FROM
	@Temp T
	INNER JOIN CDW..LNXX_BR_FOR_APV LNXX
		ON T.BF_SSN = LNXX.BF_SSN
		AND T.LN_SEQ = LNXX.LN_SEQ
		AND LNXX.LC_FOR_RSP != 'XXX'
		AND LNXX.LC_STA_LONXX ='A'
	INNER JOIN CDW..FBXX_BR_FOR_REQ FBXX
		ON FBXX.BF_SSN = LNXX.BF_SSN
		AND FBXX.LF_FOR_CTL_NUM = LNXX.LF_FOR_CTL_NUM
		AND FBXX.LC_STA_FORXX = 'A'
		AND FBXX.LC_FOR_STA = 'A'
		AND FBXX.LC_FOR_TYP = 'XX'
	INNER JOIN CDW..PDXX_PRS_NME PDXX
		ON PDXX.DF_PRS_ID = T.BF_SSN
